pragma solidity ^0.5.16;
import "openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";
import "openzeppelin-solidity/contracts/token/ERC20/ERC20Detailed.sol";

contract bnsToken is ERC20, ERC20Detailed {

    string private _name ='BNS Token';
    string private _symbol = 'BNST';
    uint8 private _decimals = 18;

    constructor() public ERC20Detailed(_name, _symbol, _decimals)
    {}
    
    function mintToSelf(uint256 _amount) public {
        _mint(msg.sender, _amount);
    }

    function burnSelf(uint256 _amount) public {
        _burn(msg.sender, _amount);
    }
}
